import { createMuiTheme } from '@material-ui/core'

export const theme = createMuiTheme({
  palette: {
    primary: {
      main: "#3d3e43",
    },
    navItem: "#d2d2d2",
    secondary: {
      main: '#89744a',
    },
    textColor: {
      main: "#ffffff"
    },
    socialIconColor: {
      main: "#f0cfca"
    },
    paginationColor: {
      main: "#F2F2F2"
    }
  },
});
